import React, {useState} from 'react'
import {Link} from "react-router-dom";

function RegisterPage() {
    const [error = "", setError] = useState("");
    function emailHandler() {
        setError("Please Enter an Email");
    }
    function usernameHandler() {
        setError("Please enter a user name");
    }
    function passHandler() {
        setError("Please enter a password");
    }
    function handleClick(){
        console.log("clicked")
        const error = document.getElementById("registerError");
        error.innerText = "you clicked register";
    }

    return (
        <div>
            <button onClick={emailHandler}>Increase</button>
            <button onClick={usernameHandler}>Decrease</button>
            <button onClick={passHandler}>Restart</button>
            <div>{error}</div>

            <form id="registerpanel">
                <h1 id="litheader">Register</h1>
                <div className="inset">
                    <p>
                        <input type="text" name="email" id="email" placeholder="Email" required/>
                    </p>
                    <p>
                        <input type="text" name="username" id="username" placeholder="User Name" required/>
                    </p>
                    <p>
                        <input type="password" name="password" id="password" placeholder="Password" required/>
                    </p>
                </div>
                <div className="p-container" id="registerError"></div>
                <p className="p-container">
                    <button onClick={handleClick}>Register</button>
                </p>
            </form>

        </div>
    );
} export default RegisterPage;
